import React from "react";

import { motion } from "framer";

import "./Projects.css";

const Project = () => {
  const variants = {
    hidden: { rotateY: 180, opacity: 0, transition: { duration: 5 } },
    visible: { opacity: 1 },
  };

  return (
    <div className="Project d-flex flex-column align-items-center justify-content-center">
      <div>
        <motion.div
          className="card bg-success"
          style={{ width: "15vw", height: "30vh" }}
          initial="visible"
          animate="visible"
          whileHover="hidden"
          variants={variants}
        >
          Hola
        </motion.div>
      </div>
    </div>
  );
};

export default Project;
